import React from 'react'
import {Container, NavBar, NavbarBrand} from 'react-bootstrap'
import logo from ' ./logo-og.png'

const NewPage = () => {

	return (
	<NavBar>
		<Container>
			<NavbarBrand href = './NewPage'>
				<img src = {logo} 
				height = '30'
				width= '30'
				className='d-inline-block align-top'
				alt='logo' />
			</NavbarBrand>
			
		</Container>
	</NavBar>
	)

};

export default NewPage;
